import "./App.css";

function App() {
  const [data, changeData] = useState("");

  const getData = async () => {
    const info = (
      await fetch(
        "http://api.weatherapi.com/v1/current.json?key=77f552816a9043c686941503221012&q=London"
      )
    ).json();
    changeData(info);
  };

  useEffect(() => {
    getData();
  }, []);

  console.log(data);
  return (
    <div>
      <p>{data}</p>
    </div>
  );
}

export default App;
